// Libs
import React from "react";
import PropTypes from "prop-types";
import classnames from "classnames";

// Utils
import { alterElement } from "../../_utils";

export function CardActions({
    children,
    className,
    actionsElementClassName: actionsElementClassNameProp,
    ...otherProps
}) {
    const actionsClassName = classnames("brain-c-card__actions", className);
    const actionsElementClassName = classnames("brain-c-card__actions-element", actionsElementClassNameProp);

    const childrenAltered = alterElement(children, {
        className: classnames(actionsElementClassName),
    });

    return (
        <div {...otherProps} className={actionsClassName}>
            {childrenAltered}
        </div>
    );
}

CardActions.propTypes = {
    /**
     * Content of card
     */
    children: PropTypes.node,
    /**
     * Additional className for content
     */
    className: PropTypes.string,
    /**
     *  Additional className for the action elements
     */
    actionsElementClassName: PropTypes.string,
};
